from typing import List

MAX = 20000
class Solution:
    def minFallingPathSum(self, grid: List[List[int]]) -> int:
        n = len(grid)

        dp = [[] for i in range(n)]
        dp[0] = grid[0]
        for i in range(1,n):
            firstMin = self.indexAndMin(dp[i-1], -1)
            secondMin =self.indexAndMin(dp[i-1], firstMin[0])
            for j in range(n):
                result = secondMin[1] if firstMin[0] == j else firstMin[1]
                dp[i].append(result+grid[i][j])
        return min(dp[-1])
        
    def indexAndMin(self, arr: List[int], ignoreIndex: int)-> List[int]:
        min = [0, MAX]
        for i in range(len(arr)):
            if ignoreIndex == i:
                continue
            if min[1] > arr[i]:
                min = [i, arr[i]]
        return min

